84,2.8850000000000002,2.886,2.887,2.888,2.8890000000000002,2.89,2.891,2.892,2.8930000000000002,2.894,2.895,2.896,2.8970000000000002,2.898,2.899,2.9,2.9010000000000002,2.902,2.903,2.904,2.9050000000000002,2.906,2.907,2.908,2.9090000000000003,2.91,2.911,2.912,2.9130000000000003,2.914,2.915,2.916,2.9170000000000003,2.918,2.919,2.92,2.9210000000000003,2.922,2.923,2.924,2.9250000000000003,2.926,2.927,2.928,2.9290000000000003,2.93,2.931,2.932,2.9330000000000003,2.934,2.935,2.936,2.9370000000000003,2.938,2.939,2.94,2.9410000000000003,2.942,2.943,2.944,2.945,2.946,2.947,2.948,2.949,2.95,2.951,2.952,2.953,2.954,2.955,2.956,2.957,2.958,2.959,2.96,2.961,2.962,2.963,2.964,2.965,2.966,2.967,2.968,2.969,2.97,2.971,2.972,2.973,2.974,2.975,2.976,2.977,2.978,2.979,2.98,2.981,2.982,2.983,2.984,2.985,2.986,2.987,2.988,2.989,2.99,2.991,2.992,2.993,2.994,2.995,2.996,2.997,2.998,2.999],"source":{"id":"15255"},"tau":3},"code":"let nu_max_preshift = nu_max_preshift_slider.value;\nlet nu_max_postshift = nu_max_postshift_slider.value;\nlet phiO_preshift = phiO_preshift_slider.value;\nlet phiO_postshift = phiO_postshift_slider.value;\nlet data = source.data;\n\n\n// Get the pre and postshift equilibrium\nlet preshift_params = ppGppEquilibrate(gamma_max,\n        nu_max_preshift,phiO_preshift, Kd_TAA, Kd_TAA_star,\n        kappa_max)\nlet postshift_params = ppGppEquilibrate(gamma_max,\n        nu_max_postshift,phiO_postshift, Kd_TAA, Kd_TAA_star,\n        kappa_max)\nconsole.log(postshift_params)\n\n// Perform the integration for the dynamic shift\nconst M0 = 1E9;\nconst dt = preshift_time[1] - preshift_time[0];\nlet preshiftNSteps = preshift_time.length; \nlet postshiftNSteps = postshift_time.length; \nlet init_params = [M0, M0 * preshift_params[0], M0 * preshift_params[1],\n                  preshift_params[2], preshift_params[3]];\n\nlet init_args = [gamma_max, nu_max_preshift, phiO_preshift, Kd_TAA, Kd_TAA_star, phiO_preshift,  0, true];\nlet dynamic_preshift = odeintForwardEuler(ppGppSelfReplicator, init_params, init_args, dt, preshiftNSteps);\ninit_params = dynamic_preshift.slice(-1);\ninit_args = [gamma_max, nu_max_postshift, phiO_postshift, Kd_TAA, Kd_TAA_star, phiO_postshift, 0, true];\nlet dynamic_postshift = odeintForwardEuler(ppGppSelfReplicator, init_params, init_args, dt, postshiftNSteps);\ndynamic_postshift = dynamic_postshift.slice(1, dynamic_postshift.length + 1);\n\n// Merge\nlet dynamic = dynamic_preshift.concat(dynamic_postshift);\nlet dynamicPhiRb = [];\nlet dynamicMRbM = []; \nlet dynamicTRNA = [];\nlet dynamicGr = [];\n\n// Preshift dynamics\nfor (var i = 0; i &lt; preshiftNSteps + postshiftNSteps; i++) {\n    let ratio = dynamic[i][4] / dynamic[i][3];\n    let tRNA = (dynamic[i][3] / Kd_TAA) + (dynamic[i][4] / Kd_TAA_star);\n    dynamicPhiRb.push(ratio / (ratio + tau));\n    dynamicMRbM.push(dynamic[i][1] / dynamic[i][0]);\n    dynamicTRNA.push(tRNA);\n    if (i &gt; 0) {\n        dynamicGr.push( Math.log(dynamic[i][0] / dynamic[i-1][0]) / dt)\n    }\n}\n\n// Update the source \ndata['phiRb'][1] = dynamicPhiRb;\ndata['Mrb_M'][1] = dynamicMRbM;\ndata['tRNA'][1] = dynamicTRNA;\ndata['lam'][1] = dynamicGr;\n\nsource.change.emit()\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING SELF-REPLICATOR MODEL\n// /////////////////////////////////////////////////////////////////////////////\n\nfunction selfReplicator(params,args, dt) { \n    let [M, M_Rb, M_Mb, c_pc, c_nt] = params;\n    let [gamma_max, nu_max, Y, phi_Rb, phi_O, Kd_cpc, Kd_cnt] = args;\n\n    // Compute the transalational efficiency\n    let gamma = gamma_max * (c_pc / (c_pc + Kd_cpc));\n    let nu = nu_max * (c_nt / (c_nt + Kd_cnt));\n\n    // Define the biomass dynamics\n    let dM_dt = gamma * M_Rb;\n    \n    // Define allocation dynamics\n    let dM_Rb_dt = phi_Rb * dM_dt;\n    let dM_Mb_dt = (1 - phi_Rb - phi_O) * dM_dt;\n\n    // Define precursor dynamics\n    let dcpc_dt = (nu * M_Mb - dM_dt * (1 + c_pc)) / M;\n\n    // Define nutrient dynamics\n    let dcnt_dt = -nu * M_Mb / Y;\n    return [dM_dt * dt, dM_Rb_dt * dt, dM_Mb_dt * dt, dcpc_dt * dt, dcnt_dt * dt]\n}\n\nfunction ppGppSelfReplicator(params, args, dt) {\n    // Unpack params\n    let [M, M_Rb, M_Mb, T_AA, T_AA_star] = params;\n    let [gamma_max, nu_max, tau, Kd_TAA, Kd_TAA_star, kappa_max, phi_O, phi_Rb, dynamic] = args;\n    \n    // Compute rates\n    let ratio = T_AA_star / T_AA;\n    let gamma = gamma_max * (T_AA_star / (T_AA_star + Kd_TAA_star));\n    let nu = nu_max * (T_AA / (T_AA + Kd_TAA));\n\n    if (dynamic == true) { \n        phi_Rb = ratio / (ratio + tau); \n    }\n\n    let kappa = phi_Rb * kappa_max;\n\n    // Define dynamics\n    let dM_dt = gamma * M_Rb;\n    let dT_AA_star_dt = (nu * M_Mb - dM_dt * (1 + T_AA_star)) / M;\n    let dT_AA_dt = kappa + (dM_dt * (1 - T_AA) - nu * M_Mb) / M;\n\n    // Define allocation\n    let dM_Rb_dt = phi_Rb * dM_dt;\n    let dM_Mb_dt = (1 - phi_O - phi_Rb) * dM_dt\n\n    // Pack and return\n    return [dM_dt * dt, dM_Rb_dt * dt, dM_Mb_dt * dt, dT_AA_dt * dt, dT_AA_star_dt * dt]\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING STEADY-STATE PARAMETERS\n// /////////////////////////////////////////////////////////////////////////////\nfunction steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let growth_rate = steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O)\n    return (nu_max * (1 - phi_Rb - phi_O) / growth_rate) - 1\n}\n\nfunction steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let Gamma = gamma_max * phi_Rb;\n    let Nu = nu_max * (1 - phi_Rb - phi_O);\n    let numer = Nu + Gamma - Math.sqrt(Math.pow(Nu + Gamma, 2) - 4 * (1 - Kd_cpc) * Nu * Gamma)\n    let denom = 2 * (1 - Kd_cpc);\n    return numer / denom\n}\n\nfunction steadyStateGamma(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let cpc = steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O);\n    return gamma_max * (cpc / (cpc + Kd_cpc));\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING ALLOCATION STRATEGIES\n// /////////////////////////////////////////////////////////////////////////////\nfunction optimalAllocation(gamma_max, nu_max, Kd_cpc, phi_O) {\n    let prefix = 1 / (4 * Kd_cpc * gamma_max * nu_max - Math.pow(nu_max + gamma_max, 2))\n    let bracket = 2 * Kd_cpc * gamma_max * nu_max - gamma_max * nu_max + Math.sqrt(Kd_cpc * gamma_max * nu_max) * (nu_max - gamma_max) - Math.pow(nu_max, 2)\n    return (1 - phi_O) * prefix * bracket\n}\n\nfunction constTranslation(gamma_max, nu_max, phi_O) { \n    return (1 - phi_O) * (nu_max / (nu_max + gamma_max))\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS FOR NUMERICAL INTEGRATION\n// /////////////////////////////////////////////////////////////////////////////\nfunction odeintForwardEuler(fun, params, args, dt, nSteps) { \n    let out = [params]; \n    for (let i=1; i &lt; nSteps ; i++) { \n        let deriv = fun(out[i-1], args, dt)\n        for (let j=0; j &lt; deriv.length; j++) {\n            deriv[j] = out[i-1][j] + deriv[j];\n        }\n        out.push(deriv);\n    }\n    return out\n}\n\nfunction ppGppEquilibrate(gamma_max, nu_max, tau, phi_O, Kd_TAA, Kd_TAA_star, kappa_max) {\n    // Determine 'optimal' allocation from simple model\n    let optPhiRb = optimalAllocation(gamma_max, nu_max, 0.01, phi_O);\n\n    // Set initial conditions\n    let M0 = 1E9;\n    let MRb = optPhiRb * M0;\n    let MMb = (1 - optPhiRb - phi_O) * M0;\n    let tAA = 0.2; \n    let tAAStar = 0.2;\n\n    // Define the timescale to integrate\n    let dt = 0.001;\n    let nSteps = parseInt(100 / dt);\n\n    // Pack parameters and args\n    let params = [M0, MRb, MMb, tAA, tAAStar];\n    let args = [gamma_max, nu_max, tau, Kd_TAA, Kd_TAA_star, kappa_max, phi_O, 0, true];\n\n    // Perform integration\n    let out = odeintForwardEuler(ppGppSelfReplicator, params, args, dt, nSteps)\n    console.log(out)\n\n    // Identify output\n    let eq = out.slice(-1)\n    // Compute steady-state params.\n    let eqPhiRb = eq[1] / eq[0];\n    let eqPhiMb = eq[2] / eq[0];\n    let eqTAA = eq[3];\n    let eqTAAStar = eq[4]; \n    return  [eqPhiRb, eqPhiMb, eqTAA, eqTAAStar]\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// MISCELLANEOUS\n// /////////////////////////////////////////////////////////////////////////////\n\n// Function for linearly spacing values. Adapted from StackOverflow user mhodges\n// https://stackoverflow.com/questions/40475155/does-javascript-have-a-method-that-returns-an-array-of-numbers-based-on-start-s\nfunction linSpace(startValue, stopValue, nSteps) {\n  let arr = [];\n  let step = (stopValue - startValue) / nSteps;\n  for (var i = 0; i &lt; nSteps; i++) {\n    arr.push(startValue + (step * i));\n  }\n  return arr;\n}\n"},"id":"15416","type":"CustomJS"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"field":"color"},"line_width":{"value":2},"xs":{"field":"time"},"ys":{"field":"lam"}},"id":"15412","type":"MultiLine"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"field":"color"},"line_width":{"value":2},"xs":{"field":"time"},"ys":{"field":"phiRb"}},"id":"15394","type":"MultiLine"},{"attributes":{"source":{"id":"15255"}},"id":"15415","type":"CDSView"},{"attributes":{},"id":"15451","type":"UnionRenderers"},{"attributes":{"data":{"Mrb_M":[{"__ndarray__":"xxmNMmeXpz+378BgVZenP0yWHZBDl6c/ANzJwDGXpz/9Tb3yH5enP+2D9SUOl6c/wStyWvyWpz/LIjOQ6panP0qEOMfYlqc/9E+C/8aWpz/TBxA5tZanPxfU4XOjlqc/8sb3r5GWpz/pUFLtf5anP7Rv7ytulqc/l5rQa1yWpz/Yu/WsSpanPxBHXu84lqc/ghsKMyeWpz87bvl3FZanP48lLL4Dlqc/zyeiBfKVpz9VW1tO4JWnP32mV5jOlac/rO+W47yVpz9GHRkwq5WnP7gV3n2Zlac/c7/lzIeVpz/sADAddpWnP5LVvG5klac/dB+MwVKVpz+7vJ0VQZWnP4qU8Wovlac//42HwR2Vpz9GkF8ZDJWnP4mCeXL6lKc//EvVzOiUpz/P03Io15SnPz0BUoXFlKc/hLty47OUpz/l6dRCopSnPxmfeKOQlKc
